import { useEffect } from 'react';
import { GetCart } from '../hooks/GetCart';

const Cart = () => {
    const { getCart, cartEntries, isLoading, error } = GetCart(); // GetCart hook

    // Fetch cart (using API) when page loads
    useEffect(() => {
        getCart();
    }, []); 
    return (
        <div className="container">
            <h1>Cart page</h1>
        </div>
    )
}

export default Cart
